      "title":"Custom 4 Player Set - Regular Hexes",
      "description":"Please visit customwoodgameboards.com for additional products and international shipping options.\r\n\r\nCustom Wood Game Boards offers accessories that are compatible with games like the Settlers of Catan\u2122 . These accessories are not affiliated with, sponsored by, nor endorsed by the Settlers of Catan\u2122 trademark holders nor their affiliates.\r\n\r\nOffering Product Description:\r\n\r\nOur wooden hexes and game pieces provide a great-looking, durable, and affordable alternative compared to the cheap, mass-produced, paper-stock hexes that are commercially available with the Settlers of Catan\u2122 board game.\r\n\r\nThis set features straight (non-interlocking) hex edges combined with our custom border which fits together snugly to hold your world intact.  The border keeps your game board from shifting during setup - making setup a breeze and it also allows you to shift the entire board easily during play.\r\n\r\n\r\n Features:\r\n\r\n    -Laser cut design in 3\/16-inch masonite\r\n    -Numbered, interlocking border joints for easy set up\r\n    -Durable\r\n    -Liquid resistant\r\n    -Wind resistant (these won&#39;t blow away or shift when playing outdoors)\r\n\r\nPieces included:\r\n\r\n    -19 hexes (4 wood, 4 wheat, 4 sheep, 3 brick, 3 ore, 1 desert)\r\n    -6 border pieces including 9 trading ports (4 any, 1 wood, 1 wheat, 1 ore, 1 brick, 1 sheep)\r\n    -18 numbers (No. 1-12 each engraved with roll frequency stats and number-placement-guide letters)\r\n    -Does NOT include the colored pieces in the pictures which are provided for demonstration purposes only\r\n\r\n\r\n**Note - in addition to our custom game boards you will need a copy of the game cards and bits & pieces which are not included in this offering and are required to play.",
